METHOD_INVOCATION: seekBar.setOnSeekBarChangeListener(new SeekBar.OnSeekBarChangeListener() {
  public @Override void onProgressChanged(SeekBar seekBar, int progress, boolean fromUser) {
    mProgressListener.onProgressChanged(seekBar, progress, fromUser);
    int curValue = mProgressListener.getCurValue();
    mCurProgress = curValue;
    contentTv.setText(String.valueOf(curValue));
    seekBar.setProgress(curValue);
  }
  public @Override void onStartTrackingTouch(SeekBar seekBar) {
    mProgressListener.onStartTrackingTouch(seekBar);
  }
  public @Override void onStopTrackingTouch(SeekBar seekBar) {
    mProgressListener.onStopTrackingTouch(seekBar);
  }
});

METHOD_INVOCATION: UtilsBridge.runOnUiThread(new Runnable() {
  public @Override void run() {
    cancel();
    iToast = newToast(utils);
    if ((view != null))
        {
          iToast.setToastView(view);
        }
    else
        {
          iToast.setToastView(text);
        }
    iToast.show(duration);
  }
});

METHOD_INVOCATION: updateAppContextLanguage(destLocal, new Utils.Consumer<Boolean>() {
  public @Override void accept(Boolean success) {
    if (success)
        {
          restart(isRelaunchApp);
        }
    else
        {
          UtilsBridge.relaunchApp();
        }
  }
});
